import React, { Component } from "react";
import { RegisteredUserFutureAppointmentsTable } from "./registeredUserFutureAppointmentsTable";

class RegisteredUserFutureAppointments extends Component {
  state = {
    user: {},
  };
  componentDidMount() {
    this.setState((this.state.user = this.props.user));
  }
  render() {
    return <RegisteredUserFutureAppointmentsTable user={this.state.user} />;
  }
}

export default RegisteredUserFutureAppointments;
